import { Route, Switch } from "react-router"



export default function renderRouters(routers) {
    return <Switch>
        {
            routers.map(e => {

                let { exact, path, component: Component, routers } = e

                let chidren = null
                if (routers) {
                    chidren = renderRouters(routers)
                }
                return <Route exact={exact} path={path} component={(prop) => <Component {...prop}>{chidren}</Component>} />
            })
        }
    </Switch>

}
